import { Box, Typography } from '@mui/material';
import React from 'react';

const Movies = () => {
  return (
    <Box margin={"auto"} marginTop={4} >
      <Typography variant="h4" padding={2} width="40%" margin bgcolor={'#900C3F'} color={'white'} textAlign={"center"}>
        All Movies
      </Typography>
    </Box>
  );
};

export default Movies;
